import React from "react"

const TodoItem = (props) => {
    return (
        <li>
            <input 
                type="checkbox" 
                checked={props.completed} 
                onChange={() => props.handleChange(props.id)}>
            </input>
            {props.title}
            <button onClick={()=>props.deleteTodoHandler(props.id)}>Delete</button>
        </li>
    )
}

export default TodoItem
